CREATE DATABASE `mymajorsdata`;
USE `mymajorsdata`;
CREATE TABLE `categories` (`id` smallint NOT NULL,`catname` varchar(100) DEFAULT NULL,PRIMARY KEY (`id`));
CREATE TABLE `jobskill` (`id` int NOT NULL AUTO_INCREMENT,`catid` smallint NOT NULL,`subcat` varchar(200) DEFAULT NULL,`skills` varchar(1000) DEFAULT NULL,PRIMARY KEY (`id`),KEY `catid` (`catid`),CONSTRAINT `jobskill_ibfk_1` FOREIGN KEY (`catid`) REFERENCES `categories` (`id`));
